from LowLevelDesign.VendingMachine.Inventory.product_enum import Productclass Inventory:    def __init__(self, product_list):        self.product_list = product_list    def update_stock(self, product, count):        product.count = count    def update_cost(self, product, cost):        product.cost = cost    def dispense_product(self, product):        product.count -= 1    def get_product_details(self, id):        for product in self.product_list:            if product._id == id:                return product        return None